import React from "react";
import { NavLink } from "react-router-dom";

export default function NavBar() {
  return (
    <div style={{padding: "100",backgroundColor: "red", }}>
      <NavLink activeStyle={{ fontWeight: "bold" }} style={{color:"white" ,display: "block",
  textAlign: "center",
  padding: "14px 16px",
  textDecoration: "none"}} to="/" exact>Home</NavLink>
      <NavLink activeStyle={{ fontWeight: "bold" }} style={{color:"white", float: "right",padding:'50'}} to="/contact">Contact</NavLink>
      <NavLink activeStyle={{ fontWeight: "bold" }} style={{color:"white",float: "right",padding:'50'}} to="/cart">Shopping Cart</NavLink>


    </div>
  );
}
